import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on "Your Profile" link
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Wait for profile page to load
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const fullName = document.querySelector('.profile-info h2')?.textContent || '';
      const username = document.querySelector('.username')?.textContent?.replace('@', '') || '';
      const bio = document.querySelector('.bio')?.textContent || '';
      const profileImage = document.querySelector('.profile-image')?.src || '';

      const stats = document.querySelectorAll('.stat');
      const ordersCount = stats[0]?.querySelector('.stat-number')?.textContent || '';
      const reviewsCount = stats[1]?.querySelector('.stat-number')?.textContent || '';
      const sellerRating = stats[2]?.querySelector('.stat-number')?.textContent || '';

      return {
        fullName,
        username,
        bio,
        profileImage,
        ordersCount,
        reviewsCount,
        sellerRating
      };
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_data.png'));

    return {
      success: true,
      action: "Successfully harvested user profile information",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
